import React from 'react';
import './Card.css';
import Tilt from 'react-parallax-tilt';


const Card = ({children}) =>{
    return(
        <Tilt className="parallax-effect" perspective={500}>
            <div className="outerCard">
                {children}
            </div>
        </Tilt>
    )
}

export default Card;
